import './footer.css'
import React from "react";

function Footer() {
    return (
        <div className="footer">
            <footer className="py-5 bg-dark fixed-bottom">
                <div class="container">
                    <p class="m-0 text-center text-white">
                        Copyright &copy; Your Website 2020
                    </p>
                </div>
            </footer>
        </div>
    );
}

export default Footer;
